ot;sans-serif&quot;; font-size: 9.0pt; line-height: 115%;"><h5>Para convertirte en usuario de KIONGO INC SAC primero debes leer y aceptar todos los t\xE9rminos y condiciones que aparecen o est\xE1n referidos en estas Condiciones de uso. Al usar nuestros productos y/o servicios estar\xE1s aceptando nuestras condiciones de uso. Si no aceptas nuestras condiciones, por favor no uses nuestros productos y/o servicios.\n\nTe recomendamos encarecidamente que, seg\xFAn vayas leyendo estas condiciones de uso, tambi\xE9n vayas consultado la informaci\xF3n vinculada. Al aceptar estas\n\ncondiciones de uso, tambi\xE9n aceptas que el uso que hagas de algunos productos y/o servicios puede regirse por condiciones de uso y pol\xEDticas de privacidad\n\npropias. Las condiciones de uso que se aplican en todos nuestros dominios y subdominios son siempre las condiciones de uso que aparecen en nuestros\n\nproductos y/o servicios. Estas Condiciones de uso entrar\xE1n el vigor el 01 de Junio del 2013 para los usuarios actuales; en el caso de nuevos usuarios,\n\nentrar\xE1n en vigor en cuanto las acepten.<\/h5><o:p><\/o:p><\/span><\/div>\n<br>\n<div class="MsoNormal" style="text-align: justify;">\n\n<b><span style="font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9.0pt; line-height: 115%;"><h3>Uso de nuestros productos y/o servicios<\/h3><o:p><\/o:p><\/span><\/b><\/div>\n<br>\n<div class="MsoNormal" style="text-align: justify;">\n\n<span style="font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9.0pt; line-height: 115%;"><h5>Cuando uses nuestros productos y/o servicios, no deber\xE1s:enviar contenidos o art\xEDculos a una categor\xEDa o \xE1rea inadecuada; usar nuestros productos y/o servicios si no se te permite establecer contratos legalmente vinculantes, eres menor de 18 a\xF1os o has sido suspendido temporal o permanentemente de productos y/o servicios; eludir ni manipular nuestra estructura de tarifas, el proceso de facturaci\xF3n o las tarifas debidas a KIONGO INC SAC; publicar contenido falso, incorrecto,enga\xF1oso, difamatorio o calumnioso (incluida la informaci\xF3n personal); llevar a cabo acciones que puedan perjudicar los sistemas de votos o valoraciones (como mostrar, importar o exportar informaci\xF3n sobre votos fuera de nuestros productos y/o servicios o usarla con fines no relacionados a los mismos; transferir tu cuenta de (incluidos los votos) y tu seud\xF3nimo a un tercero sin nuestro consentimiento; distribuir o enviar spam, cadenas de mensajes o sistemas piramidales; distribuir virus u otras tecnolog\xEDas que puedan perjudicar a KIONGO INC SAC o los intereses y propiedades de usuarios de KIONGO INC SAC; copiar, modificar o distribuir contenido de nuestros productos y/o servicios, derechos de autor y marcas comerciales de KIONGO INC SAC; ni recopilar en forma alguna informaci\xF3n acerca de los usuarios, incluidas las direcciones de correo electr\xF3nico, sin su consentimiento.<\/h5><o:p><\/o:p><\/span><\/div>\n<br>\n<div class="MsoNormal" style="text-align: justify;">\n\n<b><span style="font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9.0pt; line-height: 115%;"><h3>Abusos en nuestros productos y/o servicios<\/h3><o:p><\/o:p><\/span><\/b><\/div>\n<br>\n<div class="MsoNormal" style="text-align: justify;">\n\n<span style="font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9.0pt; line-height: 115%;"><h5>KIONGO INC SAC trabaja conjuntamente con la comunidad de usuarios para mantener nuestros productos y/o servicios en perfecto funcionamiento y proteger a la comunidad. Te rogamos que nos notifiques cualquier problema, contenido ofensivo e infracci\xF3n de la pol\xEDtica que encuentres. KIONGO INC SAC busca a asegurar que los contenidos mostrados en nuestros productos y/o servicios no infrinjan los derechos de propiedad industrial o intelectual de terceros. Si considera que sus derechos han sido vulnerados, por favor notif\xEDquelo a nuestro equipo.&nbsp; Sin limitar otras posibles acciones, podemos limitar, suspender o finalizar nuestros servicios y cuentas de usuario,prohibir el acceso a nuestro sitio Web, demorar o eliminar el contenido alojado y emprender acciones t\xE9cnicas y legales para evitar el acceso de los usuarios a nuestros productos y/o servicios si consideramos que est\xE1n provocando problemas, incurriendo en posibles responsabilidades legales o actuando de forma contraria al esp\xEDritu de nuestras pol\xEDticas. Tambi\xE9n nos reservamos el derecho a cancelar las cuentas no confirmadas o las cuentas que permanezcan inactivas durante un largo periodo de tiempo.<\/h5> <o:p><\/o:p><\/span><\/div>\n<br>\n<div class="MsoNormal" style="text-align: justify;">\n\n<b><span style="font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9.0pt; line-height: 115%;"><h3>Contenido<\/h3>\n\n<o:p><\/o:p><\/span><\/b><\/div>\n<br>\n<div class="MsoNormal" style="text-align: justify;">\n\n<span style="font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9.0pt; line-height: 115%;"><h5>Al proporcionarnos contenidos, nos concedes un derecho no exclusivo, internacional, permanente, irrevocable, libre de tasas y otorgable en sublicencia (a trav\xE9s de m\xFAltiples intermediarios) para ejercitar los derechos de autor, publicidad y bases de datos (y no otros derechos) que puedas tener sobre el contenido, en cualquier medio conocido o futuro.<\/h5><o:p><\/o:p><\/span><\/div>\n<br>\n<div class="MsoNormal" style="text-align: justify;">\n\n<b><span style="font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9.0pt; line-height: 115%;"><h3>Exenci\xF3n de responsabilidad<\/h3><o:p><\/o:p><\/span><\/b><\/div>\n<br>\n<div class="MsoNormal" style="text-align: justify;">\n\n<span style="font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9.0pt; line-height: 115%;"><h5>No podr\xE1s hacer responsable a KIONGO INC SAC del contenido, las acciones o la inactividad de otros usuarios. Si tienes una disputa con uno o varios usuarios, nos eximes de responsabilidad (tanto a nosotros como a nuestros encargados, directores, agentes, subsidiarios, asociados y empleados) ante cualquier reclamaci\xF3n, demanda y da\xF1o (real o consecuente) de cualquier tipo o naturaleza, conocidos o no, que pueda surgir como consecuencia de tal disputa o est\xE9 relacionada con ella en forma alguna.<\/h5><o:p><\/o:p><\/span><\/div>\n<br>\n<div class="MsoNormal" style="text-align: justify;">\n\n<b><span style="font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9.0pt; line-height: 115%;"><h3>Acceso e interferencia<\/h3><o:p><\/o:p><\/span><\/b><\/div>\n<br>\n<div class="MsoNormal" style="text-align: justify;"><span style="font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9.0pt; line-height: 115%;"><h5>Nuestros productos y/o servicios pueden contener encabezados de exclusi\xF3n automatizados. Gran parte de la informaci\xF3n contenida en nuestros productos y/o servicios se actualiza en tiempo real y es propiedad de KIONGO INC SAC o est\xE1 cedida bajo licencia por nuestros usuarios o terceros. Aceptas que no usar\xE1s ning\xFAn tipo de medio automatizado para acceder a nuestros sitios Web con ninguna finalidad sin contar con nuestro permiso expreso por escrito. Adem\xE1s, aceptas que no: realizar\xE1s ninguna acci\xF3n que imponga o pueda imponer (a nuestra exclusiva discreci\xF3n) una carga excesiva o desproporcionadamente grande a nuestra infraestructura; copiar\xE1s, reproducir\xE1s, modificar\xE1s, crear\xE1s derivaciones, distribuir\xE1s o mostrar\xE1s p\xFAblicamente ning\xFAn contenido (excepto tu informaci\xF3n personal) de nuestros productos y/o servicios sin el previo consentimiento expreso por escrito de KIONGO INC SAC y la correspondiente tercera parte, si fuera aplicable; interferir\xE1s ni intentar\xE1s interferir en el correcto funcionamiento de nuestros productos y/o servicios o las actividades que se realizan en ellos; ni evitar\xE1s nuestros encabezados de exclusi\xF3n automatizados u otras medidas que podamos usar para evitar o restringir el acceso a nuestros productos y/o servicios.<\/h5><o:p><\/o:p><\/span><\/div>\n<br>\n<div class="MsoNormal" style="text-align: justify;">\n\n<b><span style="font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9.0pt; line-height: 115%;"><h3>Privacidad<\/h3>\n\n<o:p><\/o:p><\/span><\/b><\/div>\n<br>\n<div class="MsoNormal" style="text-align: justify;"><span style="font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9.0pt; line-height: 115%;"><h5>Consideramos la protecci\xF3n de la privacidad de nuestros usuarios como un principio b\xE1sico de la comunidad. Almacenamos y procesamos tu informaci\xF3n en ordenadores ubicados en EE.UU. que est\xE1n protegidos por dispositivos de seguridad f\xEDsica y tecnol\xF3gica. Puedes acceder a la informaci\xF3n que nos proporcionas y modificarla cuando quieras, as\xED como indicar que no deseas recibir determinadas comunicaciones al identificarte en tu cuenta. Usamos los servicios de terceros para verificar y certificar nuestros principios de privacidad. Para obtener una descripci\xF3n completa del modo en que usamos y protegemos tu informaci\xF3n personal, consulta la Pol\xEDtica de privacidad de KIONGO INC SAC Si no deseas que tu informaci\xF3n sea transferida o utilizada del modo descrito en esta pol\xEDtica, no uses nuestros servicios.<\/h5><o:p><\/o:p><\/span><\/div>\n<br>\n<div class="MsoNormal" style="text-align: justify;">\n\n<b><span style="font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9.0pt; line-height: 115%;"><h3>Indemnizaci\xF3n<\/h3>\n\n<o:p><\/o:p><\/span><\/b><\/div>\n<br>\n<div class="MsoNormal" style="text-align: justify;">\n\n<span style="font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9.0pt; line-height: 115%;"><h5>Aceptas indemnizarnos y eximirnos de responsabilidad (tanto a nosotros como a nuestros encargados, directores, agentes, subsidiarios, asociados y empleados) ante cualquier reclamaci\xF3n o demanda, incluidos los honorarios razonables de los abogados, que realice cualquier tercera parte por o a consecuencia de que hayas infringido estas Condiciones de uso o cualquier ley o derecho de una tercera parte.<\/h5><o:p><\/o:p><\/span><\/div>\n<br>\n<div class="MsoNormal" style="text-align: justify;">\n\n<b><span style="font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9.0pt; line-height: 115%;"><h3>Relaci\xF3n entre las Partes<\/h3><o:p><\/o:p><\/span><\/b><\/div>\n<br>\n<div class="MsoNormal" style="text-align: justify;">\n\n<span style="font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9.0pt; line-height: 115%;"><h5>Mediante estas Condiciones de uso no se establece ninguna relaci\xF3n de agencia, asociaci\xF3n, Joint venture,relaci\xF3n laboral (empleado-empleador) o franquiciado-franquiciador.<\/h5><o:p><\/o:p><\/span><\/div>\n<br>\n<div class="MsoNormal" style="text-align: justify;">\n\n<b><span style="font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9.0pt; line-height: 115%;"><h3>Resoluci\xF3n de disputas<\/h3><o:p><\/o:p><\/span><\/b><\/div>\n<br>\n<div class="MsoNormal" style="text-align: justify;"><span style="font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9.0pt; line-height: 115%;"><h5>A menos que expl\xEDcitamente se indique lo contrario, estas Condiciones de Uso se regir\xE1n e interpretar\xE1n conforme a la ley peruana. Ambas partes (t\xFA y KIONGO INC SAC) aceptan someterse a la exclusiva jurisdicci\xF3n de los tribunales peruanos. En caso de surgir una disputa entre t\xFA y KIONGO INC SAC, antes de recurrir a opciones alternativas, te pedimos encarecidamente que primero te pongas en contacto directo con nosotros para buscar una soluci\xF3n:<\/h5><o:p><\/o:p><\/span><\/div>\n<br>\n<div align="center" class="MsoNormal" style="margin-bottom: 0.0001pt; text-align: center;">\n\n<br /><\/div>\n\n<div align="center" class="MsoNormal" style="
